import React, { Component } from 'react'
import "./Order.css";
import HorizontalScroll from 'react-scroll-horizontal';
import img1 from "./img-1.jpg";
import img2 from "./img-2.jpg";


export default class Order extends Component {
    render() {
        const child = { width: `30em`, height: `100%`, display: `flex`}
        const parent = { height: `22.7rem`, padding:`2% 5% 5%` }
        return (
            <section id="order-section">
                <h3 id='order-heading'>  See what we have </h3>
                <p> choose what you love and order </p>
                <div style={parent}>
                    <HorizontalScroll>
                        <div style={child}> <img src={img1} alt='nothing' /> </div>
                        <div style={child}> <img src={img2} alt='nothing' /> </div>
                        <div style={child}> <img src={img1} alt='nothing' /> </div>
                        <div style={child}> <img src={img2} alt='nothing' /> </div>
                    </HorizontalScroll>
                </div>
            </section>
        )
    }
}
